import React,{useState,useEffect} from "react";


function App() {
  const [persons, setPersons] = useState([]);

  // first data grab
    useEffect(() => {
      fetch("https://gorest.co.in/public/v1/users", {
        headers: {
          "Content-Type": "application/json",
          "Authorization": "Bearer bc1e0809f9bb5ce03125ea49290ec9c8acc225870ebd21e484217e79b88800db"
        }
      }) // your url may look different
        .then(resp => resp.json())
        .then(data => setPersons(data)) // set data to state
    }, []);
console.log(persons)

  return (
    <>
    <table >
    <thead>
            <tr>
              <th> ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Gender</th>
              <th>Status</th> 
            </tr>
          </thead>
          <tbody>

        {(persons.data).map((person) => {
          return(
                <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
                <td>{person.gender}</td>
                <td>{person.status}</td>
                </tr>)
              })}
          </tbody>
      </table>
      </>
  );
}

export default App;
